import styles from "./QnaCard.module.css";

const QnaCard = (props) => {
  return (
    <div className={styles.container} style={props.style}>
      <div className={styles.qa}>Q:</div>
      <div className={styles.text}>{props.question}</div>
      <div className={styles.qa}>A:</div>
      <div className={styles.text}>{props.answer}</div>
    </div>
  );
};

export default QnaCard;
